import React from 'react';
import './App.css';
import List from '@material-ui/core/List';
import { mainListItems } from './Components/elementos';


import Orders from './Components/tabla';

function App() {
  const classes = useStyles();
  return (
    <div className="App">
      <AppBar position="fixed">
        <Toolbar>
          <Typography variant="h6" noWrap>
            Permanent drawer
          </Typography>
        </Toolbar>
      </AppBar>
      <List>{mainListItems}</List>
      <Orders/>

    </div>
  );
}

export default App;
